function init() {
	camera = new THREE.PerspectiveCamera(50, ww/wh, 1, 5000);
	camera.position.set(-6, 0, 60);
	scene = new THREE.Scene();
	camera.lookAt(scene.position);	
	
	var spotLight = new THREE.SpotLight(0xffffff, 2, 200, Math.PI/10, .5);
	spotLight.position.set(0, 3, 100);
	scene.add(spotLight);	
	
	renderer = new THREE.WebGLRenderer({antialias: true, alpha: true});
	renderer.setPixelRatio(window.devicePixelRatio);
	renderer.setSize(ww, wh);
	//renderer.setClearColor(0x000000, 1);
	renderer.setClearColor(0x101315);
	//renderer.shadowMap.enabled = true;
	//renderer.shadowMapSoft = true;
	//renderer.shadowMap.type = THREE.PCFSoftShadowMap;
	renderer.sortObjects = false;
	
	var cntnr = document.getElementById('container');
	cntnr.appendChild(renderer.domElement);	
	controls = new THREE.OrbitControls(camera, renderer.domElement);
	controls.enableDamping = true;
	controls.dampingFactor = .25;
	controls.minDistance = 22;
	controls.maxDistance = 100;	
	controls.minPolarAngle = Math.PI/3;	
	controls.maxPolarAngle = Math.PI/1.4;
	
	loadTex1();
}	

