function langit(tex, tex2, tex3, tex4, tex5) {
	var path = "imj/map/cube/slc3/";
	var format = '.jpg';
	var urls = [
		path + 'posx' + format, path + 'negx' + format,
		path + 'posy' + format, path + 'negy' + format,
		path + 'posz' + format, path + 'negz' + format
	];
	var rCube = new THREE.CubeTextureLoader().load(urls);
	
	rCube.format = THREE.RGBFormat;
	rCube.mapping = THREE.CubeReflectionMapping;
	uLoad(tex, tex2, tex3, tex4, tex5, rCube);
	//if (callback) return callback(rCube);
}	

function genMorphT(geom) {
	var vertices1 = [], vertices2 = [], vertices3 = [], vertices4 = [];
	for (var i = 0; i < geom.vertices.length; i++) {
		vertices1.push(geom.vertices[i].clone());
		vertices2.push(geom.vertices[i].clone());		
		vertices3.push(geom.vertices[i].clone());
		vertices4.push(geom.vertices[i].clone());
		vertices1[vertices1.length-1].x = ex2[i*3];
		vertices1[vertices1.length-1].y = ex2[i*3+1];
		vertices1[vertices1.length-1].z = ex2[i*3+2];				
		vertices2[vertices2.length-1].x = ex3[i*3];
		vertices2[vertices2.length-1].y = ex3[i*3+1];
		vertices2[vertices2.length-1].z = ex3[i*3+2];		
		vertices3[vertices3.length-1].x = ex4[i*3];
		vertices3[vertices3.length-1].y = ex4[i*3+1];
		vertices3[vertices3.length-1].z = ex4[i*3+2];				
		vertices4[vertices4.length-1].x = ex5[i*3];
		vertices4[vertices4.length-1].y = ex5[i*3+1];
		vertices4[vertices4.length-1].z = ex5[i*3+2];		

	}
	geom.morphTargets.push({name: "t1", vertices: vertices1});
	geom.morphTargets.push({name: "t2", vertices: vertices2});	
	geom.morphTargets.push({name: "t3", vertices: vertices3});
	geom.morphTargets.push({name: "t4", vertices: vertices4});

}

function uLoad(tex1, tex2, tex3, tex4, tex5, ref) {
	var loadO = new THREE.OBJLoader();
	loadO.load('obj/teenf/teenf.obj', function (object) {
		var mater = new THREE.MeshPhongMaterial({shininess: 50, map: tex1, specularMap: tex2, normalMap: tex3, aoMap: tex4, aoMapIntensity: .6, lightMap: tex4, lightMapIntensity: 2.6, transparent: true, fog: false, morphTargets: true});	
		object.children[0].geometry = new THREE.Geometry().fromBufferGeometry(object.children[0].geometry);
		genMorphT(object.children[0].geometry);
		ulo = new THREE.Mesh(object.children[0].geometry, mater);
		ulo.position.y = floorPosY;		
		scene.add(ulo);
		
		var geometry = new THREE.SphereGeometry(1.86, 24, 24, 0, Math.PI);
		var mater1 = new THREE.MeshPhongMaterial({map: tex5, envMap: ref, combine: THREE.AddOperation, reflectivity: .26, fog: false});
		mata1 = new THREE.Mesh(geometry, mater1);
		mata1.position.set(-4.3, floorPosY+28.5, 10.56);
		scene.add(mata1);		
		mata2 = new THREE.Mesh(geometry, mater1);
		mata2.position.set(4.3, floorPosY+28.5, 10.56);
		scene.add(mata2);

		animate();
	});	
}
	
function animate() {
	requestAnimationFrame(animate);
	//var delta = clock.getDelta();
	if (ntro) {
		if (pif>0) {
			pif -= 0.0025;
			document.getElementById('pinfo2').style.opacity = pif;
			if (pif<=0.5) {
				pis += 0.0025;
				document.getElementById('rando').style.opacity = pis;			
				document.getElementById('controlz').style.opacity = pis;			
			}	
		} else {
			document.getElementById('pinfo2').style.opacity = 0;
			document.getElementById('pinfo2').style.display = 'none';
			document.getElementById('rando').style.opacity = .5;
			document.getElementById('controlz').style.opacity = .5;
			ntro = false;
		}
	}	
	render();
}

function render() {
	camera.lookAt(scene.position);
	if ((mata1) && (camera.position.z>32)) mata1.lookAt(camera.position);
	if ((mata2) && (camera.position.z>32)) mata2.lookAt(camera.position);	
	controls.update();	
	renderer.render(scene, camera);	
}

